import React, { useState } from 'react';
import { Box, Typography, Divider, Tabs, Tab, Table, TableBody, TableCell, 
  TableContainer, TableHead, TableRow, Paper, Card, CardContent, Button, Grid } from '@mui/material';
import AccountBalanceWalletIcon from '@mui/icons-material/AccountBalanceWallet';
import ArrowDownwardIcon from '@mui/icons-material/ArrowDownward';
import GroupIcon from '@mui/icons-material/Group';
import GroupAddIcon from '@mui/icons-material/GroupAdd';
import FooterMenu from '../Footer';
import './General.css'; // Ensure this CSS file exists

const transactions = {
  charges: Array.from({ length: 10 }, (_, i) => ({
    email: `user${i + 1}***@example.com`,
    amount: `${(Math.random() * (500 - 10) + 10).toFixed(2)} USDT`,
  })),
  withdrawals: Array.from({ length: 10 }, (_, i) => ({
    email: `user${i + 11}***@example.com`,
    amount: `${(Math.random() * (500 - 10) + 10).toFixed(2)} USDT`,
  })),
};

const General = () => {
  const [selectedTab, setSelectedTab] = useState(0);

  return (
    <div className="general-container">
      <Card className="general-card">
        <CardContent>
          <Typography variant="h4" align="center" sx={{ mb: 3 }}>
            General Overview
          </Typography>
          <Divider sx={{ mb: 3 }} />

          {/* Action Buttons */}
          <Grid container spacing={2} justifyContent="center" sx={{ mb: 3 }}>
            <Grid item xs={6} sm={3}>
              <Button fullWidth variant="contained" color="primary" startIcon={<AccountBalanceWalletIcon />}>
                Recharge
              </Button>
            </Grid>
            <Grid item xs={6} sm={3}>
              <Button fullWidth variant="contained" color="secondary" startIcon={<ArrowDownwardIcon />}>
                Withdraw
              </Button>
            </Grid>
            <Grid item xs={6} sm={3}>
              <Button fullWidth variant="contained" color="success" startIcon={<GroupIcon />}>
                Team
              </Button>
            </Grid>
            <Grid item xs={6} sm={3}>
              <Button fullWidth variant="contained" color="warning" startIcon={<GroupAddIcon />}>
                Invite
              </Button>
            </Grid>
          </Grid>

          {/* Transactions Tab */}
          <Box sx={{ width: "100%", mt: 3 }}>
            <Tabs value={selectedTab} onChange={(e, newValue) => setSelectedTab(newValue)} indicatorColor="primary" textColor="primary" centered>
              <Tab label="Recent Charges" />
              <Tab label="Recent Withdrawals" />
            </Tabs>

            <TableContainer component={Paper} sx={{ mt: 2 }}>
              <Table>
                <TableHead>
                  <TableRow>
                    <TableCell>Email</TableCell>
                    <TableCell>Amount (USDT)</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {selectedTab === 0
                    ? transactions.charges.map((item, index) => (
                        <TableRow key={index}>
                          <TableCell>{item.email}</TableCell>
                          <TableCell>{item.amount}</TableCell>
                        </TableRow>
                      ))
                    : transactions.withdrawals.map((item, index) => (
                        <TableRow key={index}>
                          <TableCell>{item.email}</TableCell>
                          <TableCell>{item.amount}</TableCell>
                        </TableRow>
                      ))}
                </TableBody>
              </Table>
            </TableContainer>
          </Box>
        </CardContent>
      </Card>

      {/* Footer Navigation */}
      <FooterMenu />
    </div>
  );
};

export default General;
